DROP TABLE IF EXISTS `reviews`;
CREATE TABLE `reviews` (
  `review_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `post_id` int(10) unsigned NOT NULL,
  `user_id` int(10) unsigned NOT NULL,
  `review_date` datetime NOT NULL,
  `originality` int(10) unsigned NOT NULL,
  `gramar` int(10) unsigned NOT NULL,
  `topic` int(10) unsigned NOT NULL,
  `note` text COLLATE utf8_czech_ci,
  PRIMARY KEY (`review_id`),
  UNIQUE KEY `post_id_user_id` (`post_id`,`user_id`),
  KEY `review_date` (`review_date`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `reviews_ibfk_3` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `reviews_ibfk_4` FOREIGN KEY (`post_id`) REFERENCES `posts` (`post_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_czech_ci;

